s','GFB Note:  Varicella 2nd dose min age is 15 months (5/2/2006).   Note from JCL:  I changed the date of administration for the second MMRV to be on the day the child turned 15 month, but the VZ test still failed.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),('grp012','test0016','MMR/Vz Mixed Test 16','The minimal interval between Vz in any vaccine is 12 weeks for children under age 13.  Four day grace does not apply.','Per Dr. Atkinson, 1/12/2007, MMR component of second vaccine is valid, VZ is not.  A valid Vz or MMRV can be repeated in 12 weeks. A valid MMR could be given in 4 weeks.','Christison','Hugh','2005-05-22','M','larry','2008-09-30','2008-08-19','Fail','No secondVZ recommended.  G.Bragg test notes:  Per MMRW Vz dose not need to be repeated if a 28 day interval is satisfied.  Note from JCL:  yes, I know this rule but I did ask Dr. A. about this particular case.  I don\'t know if the production process makes VZ as part of an MMRV different from a straight VZ.  I will call and ask again.  This doesn\'t seem right to me.  To me, both the VZ and MMR components should be ok.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),('grp012','test0024','MMR Test 24','Correctly administered and complete single antigen vaccines followed by a valid MMRV shall result in \"series complete\" for MMR','New test case:  added April 2008','Spott','Jane Sally','2004-09-09','F','larry','2008-09-30','2008-08-19','Pass','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),('grp005','test0021','DTP Product Test 21','Td # 2 administered less than 4 weeks after #1 = invalid','4 day grace does not apply.  No catch-up schedules appear in Table 1 of MMWR.  Will contact CDC about this','Milktoast','Margaret','1998-07-07','F','larry','2008-08-19','2008-08-19','Fail','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),('grp005','test0026','DTP Product Test 26','Tetramune constituted valid DTP and HIB vaccinations if administered properly.','Preferred age for administration of adolescent Tdap is 11-12 years.  Forecas